/*
 * ==============================
 * Demo Data
 * ==============================
 */

var data = {
	
	name		: 'Adrian',
	gender		: 'male',
	age			: '6',
	phone		: '0676 / 969 05 11',
	email		: 'me@adrianhana.com',
	
	friends		: [ 'Joe', 'Enrique' ],
	message		: 'Demnächst feiere ich meinen Geburtstag und würde dich hierzu gerne einladen.',
	date		: 'Do, 22.10.2015',
	time		: '16:00 Uhr',
	location	: 'luftburg',
	
	template	: 'fancy',		// can be fancy or lite
	direction	: 'map'			// can be map or qr
	
};



/*
 * ==============================
 * PDF
 * ==============================
 */
 
// PDF Size is 297x210
var doc = new jsPDF( 'landscape' );        

// Loop
$.each( data.friends, function( index, friend ) {
            
    if( index > 0 )
		doc.addPage();
		
	// Define Cover    
	if( data.template == 'fancy' ) {
		var cover = 'data:image/jpeg;base64,';
	} else if( data.template == 'lite' ) {
		var cover = 'data:image/jpeg;base64,';
	}
	
	// Define location-based vars
	if( data.location == 'luftburg' ) {
		
		var address	= 'Kolariks Luftburg,\nPrater 121, An der Hauptallee,\nA-1020 Wien';
		var map		= 'data:image/jpeg;base64,';
		var qr		= 'data:image/jpeg;base64,';
		
	} else if( data.location == 'praterfee' ) {
		
		var address = 'Kolariks Praterfee,\nPrater 121, An der Hauptallee,\nA-1020 Wien';
		var map		= 'data:image/jpeg;base64,';
		var qr		= 'data:image/jpeg;base64,';
		
	}
	
	// Define QR Code Info
	var qr_code_tip_1	= 'data:image/jpeg;base64,';
	var qr_code_tip_2	= 'data:image/jpeg;base64,';
	    
	// Texts
    var intro = 'Hallo ' + friend + ',';
	
	if(data.message) {
		
		var message = data.message;
		
	} else {
		
		if(data.age) {
			var message = 'Bald feiere ich meinen ' + (parseInt(data.age) + 1) + '. Geburtstag\nund würde mich sehr freuen\nwenn du auch kommst!';
		} else {
			var message = 'Bald feiere ich meinen Geburtstag\nund würde mich sehr freuen\nwenn du auch kommst!';
		}
		
	}
    
    if(data.gender == 'male') {
        var greetings = 'Dein ' + data.name;
    } else if(data.gender == 'female') {
        var greetings = 'Deine ' + data.name;
	}
    
	if(data.phone && data.email) {
		var info = 'Bitte lass mich wissen ob du kommen kannst unter ' + data.phone + ' oder ' + data.email;
	} else if(!data.phone && data.email) {
		var info = 'Bitte lass mich wissen ob du kommen kannst unter ' + data.email;
	} else if(data.phone && !data.email) {
		var info = 'Bitte lass mich wissen ob du kommen kannst unter ' + data.phone;
	} else if(!data.phone && !data.email) {
		var info = '';
	} 

	/**
	 * Build PDF
	 */
    
	// add cover image
    doc.addImage( cover, 'JPEG', 0, 0, 148.5, 210 );
    
	// set text color to gray
    doc.setTextColor( 100 );

    doc.setFontSize( 16 );
	
	doc.text( intro, 164.25, 20 );
	
	message = doc.splitTextToSize( message, 100 );
	
	doc.text(message, 164.25, 35);
	doc.text(greetings, 164.25, 60);
		
    doc.setDrawColor(200);
	doc.setLineWidth(0.1);
    doc.line(164.25, 70, 284.25, 70);
    doc.line(164.25, 125, 284.25, 125);
    doc.line(164.25, 185, 284.25, 185);
      
    doc.setFontSize(16);
	doc.setTextColor(255,146,38);
    doc.text(doc.splitTextToSize("WANN?", 100), 164.25, 80);
    
	doc.setFontSize(14);
	doc.setTextColor(100);
    doc.text(doc.splitTextToSize(data.date + ' - ' + data.time, 100), 164.25, 87);
	
    doc.setFontSize(16);
	doc.setTextColor(255,146,38);
    doc.text( doc.splitTextToSize( "WO?", 100 ), 164.25, 100 );
	
    doc.setFontSize( 14 );
	doc.setTextColor( 100 );
	
	// add address & qr code
	doc.text( doc.splitTextToSize( address, 100 ), 164.25, 107 );
	
	if( data.direction == 'map' ) {
		doc.addImage( map, 'JPEG', 164.25, 130, 120, 50 );   	    
	} else if( data.direction == 'qr') {
		doc.addImage( qr, 'JPEG', 209.75, 140, 30, 30 ); 
		doc.addImage( qr_code_tip_1, 'JPEG', 169.25, 135, 30, 22 );   	    
		doc.addImage( qr_code_tip_2, 'JPEG', 244.75, 140, 30, 22 );   	    
	}

	// add info
    doc.setFontSize( 12 );
    info = doc.splitTextToSize( info, 100 );
    doc.text( info, 164.25, 195 );
		
});